INSERT INTO `bugs` VALUES ('b641114c-18da-c313-cf1a-4f3d5fbf36ee','circuitTestRecord','2012-02-16 19:55:48','2012-02-19 18:39:44','9673dc31-3233-8829-d8af-4f3d55b2ff3c','9673dc31-3233-8829-d8af-4f3d55b2ff3c','Test Bug',1,'b382dde4-a6f4-b9c9-76b7-4f3d574329b1',1,'Defect','New','Low','Accepted',NULL,'887830ae-5478-7009-9285-4f3d5cfc44e7','887830ae-5478-7009-9285-4f3d5cfc44e7','Internal','HOMIR'),('34ce799a-f3d9-f766-1e0a-4f3e4c6f5333','JBilling Item Id\'s needs to pass for creating the Order','2012-02-17 12:47:02','2012-02-17 12:47:02','9673dc31-3233-8829-d8af-4f3d55b2ff3c','9673dc31-3233-8829-d8af-4f3d55b2ff3c','All  the Orders Item Id is harcoded in HOMIR as 1. JBilling is always creating orders against this Item.\r\nThis needs to be changed to pass the correct JBilling Item Id\'s. Currently the Synchronisation of both system catalogue is happening though database side. ',0,'529b1975-f375-4559-0442-4f3d597ffd41',2,'Defect','New','Urgent','Accepted',NULL,NULL,NULL,'Internal','HOMIR'),('8680e2a5-cd28-69a7-cdda-4f3fb4b7d946','InvoiceId in Invoice is not coming correctly','2012-02-18 14:25:20','2012-02-18 14:25:20','9673dc31-3233-8829-d8af-4f3d55b2ff3c','9673dc31-3233-8829-d8af-4f3d55b2ff3c','InvoiceId in Invoice not coming correctly.',0,'9673dc31-3233-8829-d8af-4f3d55b2ff3c',3,'Defect','New','Urgent','Accepted',NULL,NULL,NULL,'Internal','JBILLING'),('9bc91d90-b73d-9484-406c-4f3fe27fe416','Mapping of Product Catalog of Homir to JBilling','2012-02-18 17:39:35','2012-02-29 00:06:54','2bf53c62-efbb-f811-41f8-4f3d64001d45','9673dc31-3233-8829-d8af-4f3d55b2ff3c','Mapping of Product Catalog of Homir to JBilling. Dave to have Ash build Product Management in SugarCRM, then integrate with HOMIR. If Manish comes available to write integration we will do that. Otherwise we\'ll have Ash write the integration.',0,'b382dde4-a6f4-b9c9-76b7-4f3d574329b1',4,'Feature','Pending','High','Later',NULL,'887830ae-5478-7009-9285-4f3d5cfc44e7',NULL,'Internal','HOMIR'),('167800c3-797a-dc87-8559-4f4d253fc631','Parent Order Issues','2012-02-28 19:06:48','2012-02-28 22:55:26','3f1eeaaf-26fa-30f4-f990-4f3d62566304','2bf53c62-efbb-f811-41f8-4f3d64001d45','Add Contact\r\n- Clean Up Validation messages on add contact screen\r\n- Clicking Add Contact had no effect, system did nothing\r\nAdd Location\r\n- Add validation to Add Location screen\r\n- \"Add Contact\" button should read \"Add Location\"\r\nAdd Parent Order Line Items (POLIs)\r\n- Make first option in \"Type\" drop down be \"Select\" and validate that something is chosen.\r\nRelate to SubOrder\r\n- After relating POLI to SubOrder, when returning to the Parent Order the relation of the POLI to the SubOrder needs to be shown. i.e. if I related the POLI \"3.0 Mbps Circuit\" to two SubOrders: \"Circuit SubOrder 1\" and \"Circuit SubOrder 2\", links to those SubOrders should be provided on the screen. Maybe in the same column as the check boxes on the right, or maybe in the their own column.\r\n\r\nTEST ADD from Bryant 2/28 3pm',0,'529b1975-f375-4559-0442-4f3d597ffd41',5,'Feature','New','Urgent',NULL,NULL,NULL,NULL,NULL,NULL);
/*!40000 ALTER TABLE `bugs` ENABLE KEYS */;
