tLevel will assist your technician with the proper router settings</li>\n</ul>\n</ul>\n<br />\n<ul>\n<ul>\n<li style=\"font-size: x-small;\">NextLevel support is 24/7 and US based</li>\n</ul>\n</ul>\n<br />\n<ul>\n<ul>\n<li style=\"font-size: x-small;\">Anywhere client plugs in the phone with an internet (anywhere in the world) the phone will be up and running as if phone was in the office</li>\n</ul>\n</ul>\n<br />\n<ul>\n<ul>\n<li style=\"font-size: x-small;\">There are no typical Upgrade or Maintenance fees</li>\n</ul>\n</ul>\n<br />\n<ul>\n<ul>\n<li style=\"font-size: x-small;\">100% uptime guarantee</li>\n</ul>\n</ul>\n<br />\n<ul>\n<ul>\n<li style=\"font-size: x-small;\">Waived Install fees with a 2 year term</li>\n</ul>\n</ul>','',0),('91e82c5e-3dd7-9c00-12ab-4fd0e2d1df45','Dave Ferrell <dave@technologyconsulting.biz>','','daferrell99@gmail.com','','','Quote Attached, blah, blah, blah','Quote Attached, blah, blah, blah','',0);
